import React, { useContext, useState } from 'react';
import { TodoContext } from '../context/TodoContext';
import { Table, Button, Modal, Container, Row, Col } from 'react-bootstrap';
import UserFilter from './UserFilter';
import CompletedFilter from './CompletedFilter';

const TodoList = () => {
  const {
    users, todos, changeStatus, feedback, clearFeedback,
    filterUsers, setFilterUsers, filterCompleted, setFilterCompleted
  } = useContext(TodoContext);

  const [sortOrder, setSortOrder] = useState('asc');

  const handleSort = () => {
    setSortOrder(sortOrder === 'asc' ? 'desc' : 'asc');
  };

  const filteredTodos = todos.filter(todo => {
    const userFilter = filterUsers.length === 0 || filterUsers.includes(todo.userId.toString());
    const completedFilter = filterCompleted === '' || todo.completed === (filterCompleted === 'true');
    return userFilter && completedFilter;
  }).sort((a, b) => {
    if (sortOrder === 'asc') {
      return a.title.localeCompare(b.title);
    } else {
      return b.title.localeCompare(a.title);
    }
  });

  return (
    <Container>
      <Row>
        <Col md={9}>
          {feedback && (
            <Modal show={feedback !== null} onHide={clearFeedback}>
              <Modal.Header closeButton>
                <Modal.Title>Feedback</Modal.Title>
              </Modal.Header>
              <Modal.Body>{feedback}</Modal.Body>
              <Modal.Footer>
                <Button variant="secondary" onClick={clearFeedback}>
                  Close
                </Button>
              </Modal.Footer>
            </Modal>
          )}
          <Button className="mb-3" onClick={handleSort}>
            Sort: {sortOrder === 'asc' ? 'Ascending' : 'Descending'} by Title
          </Button>
          <Table striped bordered hover>
            <thead>
              <tr>
                <th>No.</th>
                <th>Title</th>
                <th>User</th>
                <th>Completed</th>
                <th>Change Status</th>
              </tr>
            </thead>
            <tbody>
              {filteredTodos.map(todo => {
                const user = users.find(user => user.id === todo.userId);
                return (
                  <tr key={todo.id}>
                    <td>{todo.id}</td>
                    <td>{todo.title}</td>
                    <td>{user ? user.name : 'Unknown User'}</td>
                    <td>{todo.completed ? 'Finished' : 'Unfinished'}</td>
                    <td><Button variant="primary" onClick={() => changeStatus(todo.id)}>Change</Button></td>
                  </tr>
                );
              })}
            </tbody>
          </Table>
        </Col>
        <Col md={3}>
          <UserFilter users={users} filterUsers={filterUsers} setFilterUsers={setFilterUsers} />
          <CompletedFilter filterCompleted={filterCompleted} setFilterCompleted={setFilterCompleted} />
        </Col>
      </Row>
    </Container>
  );
};

export default TodoList;
